import React from "react";
import {Container} from "react-bootstrap";


export const Footer = () => (
    <Container fluid style={{ backgroundColor: '#000', color: '#fff'}}>
        <Container  style={{display: 'flex', justifyContent: 'column', padding: '10px'}}>
            <p>Snow Shop</p>
            <p>Company</p>
            <p>Skis</p>
            <p>Snowboards</p>
        </Container>
    </Container>
)
